    public class MergeTestUtils
    {
        protected readonly Point _location = new Point(10, 10);
        protected DsfMultiAssignActivity _multiAssign = new DsfMultiAssignActivity
        {
            UniqueID = Guid.NewGuid().ToString(),
            DisplayName = "MultiAssign"
        };
        protected ModelItem _modelItem;
        readonly IServiceDifferenceParser _serviceDifferenceParser = new ServiceDifferenceParser(new ActivityParser(), new ResourceDefinationCleaner());

        private static Mock<IContextualResourceModel> CreateResourceModel(string xamlDefinition)
        {
            var mockServer = new Mock<IServer>();
            mockServer.Setup(a => a.Name).Returns("localhost");

            var mockPopupController = new Mock<IPopupController>();
            var mockServerRepository = new Mock<IServerRepository>();
            mockServerRepository.Setup(a => a.ActiveServer).Returns(mockServer.Object);
            mockServerRepository.Setup(a => a.IsLoaded).Returns(true);

            CustomContainer.Register(mockPopupController.Object);
            CustomContainer.Register(mockServerRepository.Object);

            IResourceDefinationCleaner resourceDefination = new ResourceDefinationCleaner();
            var resourceModel = Dev2MockFactory.SetupResourceModelMock();

            var assignExampleBuilder = new StringBuilder(xamlDefinition);
            var resource = resourceDefination.GetResourceDefinition(true, resourceModel.Object.ID, assignExampleBuilder);
            var dev2JsonSerializer = new Dev2JsonSerializer();
            var msg = dev2JsonSerializer.Deserialize<ExecuteMessage>(resource);

            resourceModel.Setup(resModel => resModel.WorkflowXaml).Returns(assignExampleBuilder);
            resourceModel.Setup(resModel => resModel.ResourceName).Returns("MergePositionChange");
            resourceModel.Setup(resModel => resModel.Environment).Returns(mockServer.Object);
            resourceModel.Setup(resModel => resModel.Environment.Connection.ServerEvents).Returns(new Mock<IEventPublisher>().Object);
            resourceModel.Setup(resModel => resModel.Environment.ResourceRepository.FetchResourceDefinition(It.IsAny<IServer>(), It.IsAny<Guid>(), It.IsAny<Guid>(), It.IsAny<bool>()))
              .Returns(new ExecuteMessage { Message = msg.Message, HasError = false });
            return resourceModel;
        }

        protected (List<ConflictTreeNode> currentTree, List<ConflictTreeNode> diffTree) CreateConflictTreeNodeList()
        {
            var resourceModelCurrent = CreateResourceModel(WorkflowTestResources.MergePositionChange.Current);
            var resourceModelDiff = CreateResourceModel(WorkflowTestResources.MergePositionChange.Different);

            var (currentTree, diffTree) = _serviceDifferenceParser.GetDifferences(resourceModelCurrent.Object, resourceModelDiff.Object, false);

            return (currentTree, diffTree);
        }

        private static ConflictModelFactory CreateConflictModelFactory(string xamlDefinition)
        {
            var mockApplicationAdapter = new Mock<IApplicationAdaptor>();
            mockApplicationAdapter.Setup(a => a.Current).Returns(Application.Current);
            CustomContainer.Register(mockApplicationAdapter.Object);

            var resourceModel = CreateResourceModel(xamlDefinition);

            var conflictModelFactory = new ConflictModelFactory(resourceModel.Object);
            return conflictModelFactory;
        }

        protected static ConflictModelFactory CreateCurrentConflictModelFactory()
        {
            return CreateConflictModelFactory(WorkflowTestResources.MergePositionChange.Current);
        }

        protected static ConflictModelFactory CreateDiffConflictModelFactory()
        {
            return CreateConflictModelFactory(WorkflowTestResources.MergePositionChange.Different);
        }

        protected ToolConflictRow CreateConflictRow()
        {
            var (currentTree, diffTree) = CreateConflictTreeNodeList();

            var currentConflictModelFactory = CreateCurrentConflictModelFactory();
            var diffConflictModelFactory = CreateDiffConflictModelFactory();
            var rowList = CreateMockConflictRowList();
            var toolConflictItem1 = new ToolConflictItem(rowList, ConflictRowList.Column.Current);
            var toolConflictItem2 = new ToolConflictItem(rowList, ConflictRowList.Column.Current);
            var currentViewModel = currentConflictModelFactory.CreateModelItem(toolConflictItem1, currentTree[0]);
            var diffViewModel = diffConflictModelFactory.CreateModelItem(toolConflictItem2, diffTree[0]);

            var connectors = new List<IConnectorConflictRow>();

            return ToolConflictRow.CreateConflictRow(currentViewModel, diffViewModel, connectors);
        }

        protected static ToolConflictRow CreateStartRow()
        {
            var mockApplicationAdapter = new Mock<IApplicationAdaptor>();
            mockApplicationAdapter.Setup(a => a.Current).Returns(Application.Current);
            CustomContainer.Register(mockApplicationAdapter.Object);

            var imageSource = new DrawingImage();
            
            var startConflictItemCurrent = NewStartConflictItem(imageSource);
            var startConflictItemDiff = NewStartConflictItem(imageSource);
            return ToolConflictRow.CreateStartRow(startConflictItemCurrent, startConflictItemDiff);
        }

        protected ToolConflictItem CreateToolConflictItem()
        {
            _modelItem = ModelItemUtils.CreateModelItem(_multiAssign);
            var rowList = CreateMockConflictRowList();
            var toolConflictItem = new ToolConflictItem(rowList, ConflictRowList.Column.Current)
            {
                Activity = _multiAssign,
                UniqueId = Guid.Parse(_multiAssign.UniqueID),
                MergeDescription = _multiAssign.GetDisplayName(),
                FlowNode = _multiAssign.GetFlowNode(),
                ModelItem = _modelItem,
                NodeLocation = _location
            };
            return toolConflictItem;
        }
        static ConflictRowList CreateMockConflictRowList()
        {
            var modelFactoryCurrent = new Mock<IConflictModelFactory>();
            var modelFactoryDifferent = new Mock<IConflictModelFactory>();
            var currentTree = new List<ConflictTreeNode>();
            var diffTree = new List<ConflictTreeNode>();
            return new ConflictRowList(modelFactoryCurrent.Object, modelFactoryDifferent.Object, currentTree, diffTree);
        }

        protected static ToolConflictItem NewStartConflictItem(DrawingImage imageSource)
        {
            var rowList = CreateMockConflictRowList();
            return ToolConflictItem.NewStartConflictItem(rowList, ConflictRowList.Column.Current, imageSource);
        }

        protected MergeWorkflowViewModel CreateMergeWorkflowViewModel()
        {
            var resourceModelCurrent = CreateResourceModel(WorkflowTestResources.MergePositionChange.Current);
            var resourceModelDiff = CreateResourceModel(WorkflowTestResources.MergePositionChange.Different);

            CustomContainer.Register(_serviceDifferenceParser);

            return new MergeWorkflowViewModel(resourceModelCurrent.Object, resourceModelDiff.Object, false);
        }

        protected ConflictRowList CreateConflictRowList()
        {
            var modelFactoryCurrent = CreateCurrentConflictModelFactory();
            var modelFactoryDifferent = CreateDiffConflictModelFactory();

            var (currentTree, diffTree) = CreateConflictTreeNodeList();

            var conflictList = new ConflictRowList(modelFactoryCurrent, modelFactoryDifferent, currentTree, diffTree);
            return conflictList;
        }

        private static MergePreviewWorkflowDesignerViewModel CreateMergePreviewWorkflowDesignerViewModel()
        {
            var resourceModelCurrent = CreateResourceModel(WorkflowTestResources.MergePositionChange.Current);
            return new MergePreviewWorkflowDesignerViewModel(resourceModelCurrent.Object);
        }

        protected MergePreviewWorkflowStateApplier CreateMergePreviewWorkflowStateApplier()
        {
            return new MergePreviewWorkflowStateApplier(CreateConflictRowList(), CreateMergePreviewWorkflowDesignerViewModel());
        }

        protected ConflictListStateApplier CreateConflictListStateApplier()
        {
            return new ConflictListStateApplier(CreateConflictRowList());
        }
    }
}
